import React, { useState, useEffect } from 'react'
import axios from "axios"
import { Route, Link } from "react-router-dom"

const randomUrl = "https://api.unsplash.com/photos/random/?client_id=1kV8nZ5_pV1wBQJB_prZ0Rs5pkpTarBY2-NNW7X-_yg"


export default function Random() {

  const [randomImages, updateimages] = useState([])
  useEffect(() => {
    const apiCall = async () => {
      const randomImages = await axios(randomUrl)
      console.log(randomImages)
      console.log(randomImages.data)


      updateimages(randomImages.data)
    }
    apiCall()
  }, [])


  return (
    <>
      <nav>
        <Link to="/random"><button>Random</button></Link>
      </nav>
      <Route path="/random" >
        <h1>{randomImages.data.map(image => <h1>{image.data.id}</h1> )}</h1>
      </Route>




    </>
  )
}
